import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./pages/Home";
import DetailTour from "./pages/DetailTour";
import Payment from "./pages/Payment";
import PaymentPending from "./pages/PaymentPending";
import { useState } from "react";
import Profile from "./pages/Profile";
import IncomeTrip from "./pages/IncomeTrip";
import PrivateRootUser from "./components/PrivateRootUser";

function App() {
  const dataLog = JSON.parse(localStorage.getItem("Login"));
  const [isLogin, setIsLogin] = useState();
  setIsLogin(dataLog.role == "admin" ? true : false);

  // const [Number, SetNumber] = useState(0);
  // function add() {
  //   SetNumber(Number + 1);
  // }
  // function less() {
  //   if (Number > 0) {
  //     SetNumber(Number - 1);
  //   }
  // }

  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/detail/:id" element={<DetailTour />} />

          <Route element={<PrivateRootUser isLogin={isLogin} />}>
            <Route path="/profile" element={<Profile />} />
            <Route path="/payment" element={<Payment />} />
            <Route path="/paymentpending" element={<PaymentPending />} />
          </Route>

          <Route path="/IncomeTrip" element={<IncomeTrip />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
